import React, { Component } from 'react';

class Social extends Component {
    render() {
        return (
            <div className="social">
                <a href="https://codepen.io/Barber"><i className="fab fa-codepen"></i></a>
                <a href="https://github.com/JRB1990"><i className="fab fa-github"></i></a>
                <a href="https://www.facebook.com/joshua.barber.906"><i className="fab fa-facebook-f"></i></a>
                <a href="https://www.linkedin.com/in/joshua-barber-1990/"><i className="fab fa-linkedin-in"></i></a>
            </div>
        );
    }
};

export default Social;
